-- ----------------------------
-- View structure for view_analisis_consumo
-- ----------------------------
DROP VIEW IF EXISTS `view_analisis_consumo`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `view_analisis_consumo` AS SELECT
masterarticulos.ARTICULO,
masterarticulos.DESCRIPCION,
masterarticulos.LABORATORIO,
masterarticulos.UNIDAD,
masterarticulos.PROVEEDOR,
masterarticulos.CANT_DISPONIBLE,
IFNULL(tblarticuloabc.M3_PRIVADA,0) AS M3_PRIVADA,
IFNULL(tblarticuloabc.M3_PUBLICA,0) AS M3_PUBLICA,
masterarticulos.CONTRATO_ANUAL/masterarticulos.FACTOREMPAQUE AS CONTRATO_ANUAL,
masterarticulos.PEDDCA,
(tblarticuloabc.FPUBLICA1+tblarticuloabc.FPUBLICA2+tblarticuloabc.FPUBLICA3+
tblarticuloabc.FPUBLICA4+tblarticuloabc.FPUBLICA5+tblarticuloabc.FPUBLICA6+tblarticuloabc.FPUBLICA7
+tblarticuloabc.FPUBLICA8+tblarticuloabc.FPUBLICA9+tblarticuloabc.FPUBLICA10+tblarticuloabc.FPUBLICA11
+tblarticuloabc.FPUBLICA12+tblarticuloabc.FPUBLICA13) as CONSUMO_PUBLICO_12MESES,
tblarticuloabc.ORDENADO_CONTRATO_CRUZ_AZUL,
masterarticulos.CTBP,
masterarticulos.CTTS,
IFNULL(tblarticuloabc.MESES_DE_EXIXTENCIA_PROMEDIO_MASALTOS,0) AS MESES_DE_EXIXTENCIA_PROMEDIO_MASALTOS,
IFNULL(tblarticuloabc.INVENTARIO_MINIMO_PUNTO_REORDEN,0) AS INVENTARIO_MINIMO_PUNTO_REORDEN,
IFNULL(tblarticuloabc.ORDENAR,0) AS ORDENAR,
masterarticulos.CLASE_ABC,
(SELECT SUM(lotesvendidos.CANT_DISPONIBLE) FROM lotesvendidos
 where lotesvendidos.ARTICULO = masterarticulos.ARTICULO) AS VENCIDO,
IFNULL(tblarticuloabc.PROMEDIO_MENSUAL_FARM_INSTPRIV,0) AS PROMEDIO_MENSUAL_FARM_INSTPRIV,
IFNULL(tblarticuloabc.PROMEDIO_MENSUAL_INSTPUBLICA,0) AS PROMEDIO_MENSUAL_INSTPUBLICA,
tblarticuloabc.FECHA_CONTRATO,
comentarios.Comnet3
FROM
masterarticulos
LEFT JOIN tblarticuloabc ON masterarticulos.ARTICULO = tblarticuloabc.ARTICULO
LEFT JOIN lotesvendidos ON masterarticulos.ARTICULO = lotesvendidos.ARTICULO
LEFT JOIN comentarios ON masterarticulos.ARTICULO = comentarios.Articulo
GROUP BY
masterarticulos.ARTICULO,
masterarticulos.DESCRIPCION,
masterarticulos.LABORATORIO,
masterarticulos.UNIDAD,
masterarticulos.PROVEEDOR,
masterarticulos.CANT_DISPONIBLE,
tblarticuloabc.M3_PRIVADA,
tblarticuloabc.M3_PUBLICA,
masterarticulos.CONTRATO_ANUAL,
masterarticulos.PEDDCA,
tblarticuloabc.CONSUMO_PUBLICO_12MESES,
tblarticuloabc.ORDENADO_CONTRATO_CRUZ_AZUL,
masterarticulos.CTBP,
masterarticulos.CTTS,
tblarticuloabc.MESES_DE_EXIXTENCIA_PROMEDIO_MASALTOS,
tblarticuloabc.INVENTARIO_MINIMO_PUNTO_REORDEN,
tblarticuloabc.ORDENAR,
masterarticulos.CLASE_ABC ;

